import { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { getBabysitterById, createReservation } from '../services/api';
import { StarIcon, CalendarIcon, ClockIcon } from '@heroicons/react/24/outline';
import { useAuth } from '../context/AuthContext';

export default function BabysitterProfile() {
  const { id } = useParams();
  const navigate = useNavigate();
  const { user } = useAuth();
  const [babysitter, setBabysitter] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [reservationData, setReservationData] = useState({
    date: '',
    time: '',
    duration: 1,
    description: '',
  });

  useEffect(() => {
    fetchBabysitterDetails();
  }, [id]);

  const fetchBabysitterDetails = async () => {
    try {
      setLoading(true);
      const response = await getBabysitterById(id);
      // Handle different response structures
      const babysitterData = response.data?.data || response.data;
      setBabysitter(babysitterData);
    } catch (err) {
      console.error('Error fetching babysitter:', err);
      setError('Failed to fetch babysitter details');
    } finally {
      setLoading(false);
    }
  };

  const handleReservationChange = (e) => {
    const { name, value } = e.target;
    setReservationData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleReservationSubmit = async (e) => {
    e.preventDefault();
    if (!user) {
      navigate('/login');
      return;
    }

    try {
      await createReservation({
        ...reservationData,
        babysitterId: id,
      });
      navigate('/reservations');
    } catch (err) {
      setError('Failed to create reservation');
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="w-16 h-16 border-4 border-primary-500 border-t-transparent rounded-full animate-spin"></div>
      </div>
    );
  }

  if (error || !babysitter) {
    return (
      <div className="text-center py-12">
        <h2 className="text-2xl font-semibold text-gray-900">
          {error || 'Babysitter not found'}
        </h2>
      </div>
    );
  }

  return (
    <div className="bg-gray-100 min-h-screen py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="bg-white rounded-lg shadow overflow-hidden">
          {/* Profile Header */}
          <div className="p-6 sm:p-8 border-b border-gray-200">
            <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between">
              <div className="flex items-center">
                <div className="h-16 w-16 rounded-full bg-primary-500 flex items-center justify-center text-white text-2xl font-semibold">
                  {babysitter.name?.[0] || '?'}
                </div>
                <div className="ml-4">
                  <h1 className="text-2xl font-bold text-gray-900">{babysitter.name}</h1>
                  <div className="flex items-center mt-1">
                    <StarIcon className="h-5 w-5 text-yellow-400" />
                    <span className="ml-1 text-sm text-gray-600">
                      {babysitter.rating || 0} ({babysitter.totalReviews || 0} reviews)
                    </span>
                  </div>
                </div>
              </div>
              <div className="mt-4 sm:mt-0">
                <span className="text-3xl font-bold text-primary-600">${babysitter.tarif || 0}/hr</span>
              </div>
            </div>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-6 p-6 sm:p-8">
            {/* Left Column - Details */}
            <div className="md:col-span-2 space-y-6">
              <div>
                <h2 className="text-lg font-semibold text-gray-900">About Me</h2>
                <p className="mt-2 text-gray-600">{babysitter.bio || 'No bio available'}</p>
              </div>

              <div>
                <h2 className="text-lg font-semibold text-gray-900">Experience & Skills</h2>
                <div className="mt-2">
                  <p className="text-gray-600">{babysitter.experience || 0} years of experience</p>
                  <div className="mt-2 flex flex-wrap gap-2">
                    {babysitter.competances?.map((skill, index) => (
                      <span
                        key={index}
                        className="inline-flex items-center px-3 py-1 rounded-full text-sm font-medium bg-primary-100 text-primary-800"
                      >
                        {skill}
                      </span>
                    ))}
                  </div>
                </div>
              </div>

              {/* Reviews Section */}
              <div>
                <h2 className="text-lg font-semibold text-gray-900">Reviews</h2>
                <div className="mt-2 space-y-4">
                  {babysitter.reviews?.map((review) => (
                    <div key={review._id} className="border-b border-gray-200 pb-4">
                      <div className="flex items-center">
                        <div className="h-8 w-8 rounded-full bg-gray-200 flex items-center justify-center">
                          {review.parent?.name?.[0] || '?'}
                        </div>
                        <div className="ml-3">
                          <p className="text-sm font-medium text-gray-900">{review.parent?.name || 'Anonymous'}</p>
                          <div className="flex items-center">
                            {[...Array(5)].map((_, i) => (
                              <StarIcon
                                key={i}
                                className={`h-4 w-4 ${
                                  i < (review.rating || 0) ? 'text-yellow-400' : 'text-gray-300'
                                }`}
                              />
                            ))}
                          </div>
                        </div>
                      </div>
                      <p className="mt-2 text-sm text-gray-600">{review.comment}</p>
                    </div>
                  ))}
                </div>
              </div>
            </div>

            {/* Right Column - Booking Form */}
            <div>
              <div className="bg-gray-50 p-6 rounded-lg">
                <h2 className="text-lg font-semibold text-gray-900 mb-4">Book a Session</h2>
                <form onSubmit={handleReservationSubmit} className="space-y-4">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Date</label>
                    <input
                      type="date"
                      name="date"
                      required
                      value={reservationData.date}
                      onChange={handleReservationChange}
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-primary-500 focus:ring-primary-500"
                    />
                  </div>

                  <div>
                    <label className="block text-sm font-medium text-gray-700">Time</label>
                    <input
                      type="time"
                      name="time"
                      required
                      value={reservationData.time}
                      onChange={handleReservationChange}
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-primary-500 focus:ring-primary-500"
                    />
                  </div>

                  <div>
                    <label className="block text-sm font-medium text-gray-700">Duration (hours)</label>
                    <input
                      type="number"
                      name="duration"
                      min="1"
                      max="12"
                      required
                      value={reservationData.duration}
                      onChange={handleReservationChange}
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-primary-500 focus:ring-primary-500"
                    />
                  </div>

                  <div>
                    <label className="block text-sm font-medium text-gray-700">Description</label>
                    <textarea
                      name="description"
                      rows="3"
                      value={reservationData.description}
                      onChange={handleReservationChange}
                      className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-primary-500 focus:ring-primary-500"
                      placeholder="Tell us about your needs..."
                    ></textarea>
                  </div>

                  <button
                    type="submit"
                    className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
                  >
                    Book Now
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
